import React, { PureComponent } from "react";
import { Chart } from "react-google-charts";
import Card from "pnnl-react-core/lib/Card";

class LCSGoogleGraph extends PureComponent {
  constructor(props) {
    super(props);
    var lcs = this.props.data;

    this.data = [
      [
        "Huebin-Angle",
        "Local-Chroma Shift",
        { role: "style" },
        {
          sourceColumn: 0,
          role: "annotation",
          type: "string",
          calc: "stringify"
        }
      ],
      ["1", lcs[0], "color: #b45c60", null],
      ["2", lcs[1], "color: #cb7761", null],
      ["3", lcs[2], "#cb824b", null],
      ["4", lcs[3], "#d7ad67", null],
      ["5", lcs[4], "#ac9a5d", null],
      ["6", lcs[5], "#919E60", null],
      ["7", lcs[6], "#678B5F", null],
      ["8", lcs[7], "#62B08F", null],
      ["9", lcs[8], "#7CBABA", null],
      ["10", lcs[9], "#2C797D", null]
    ];

    //this.data = [

    //]
  }

  render() {
    return (
      <Card>
        <Chart
          width={"800px"}
          height={"300px"}
          chartType="ColumnChart"
          loader={<div>Loading Chart</div>}
          data={this.data}
          options={{
            chart: {
              title: "Company Performance",
              subtitle: "Sales, Expenses, and Profit: 2014-2017"
            },
            legend: { position: "none" }
          }}
          // For tests
          rootProps={{ "data-testid": "4" }}
        />
      </Card>
    );
  }
}

export default LCSGoogleGraph;
